import React from 'react';
import './App.css';
import { Routes, Route, Link } from "react-router-dom";
import {
  Home
} from "./component";


function App() {
  return (
    <div className="App">
      <Route path ="/" element={<Home />} />
    </div>
  );
}

export default App;
